import React from "react";

const Header = (props) => {
    const { name, children } = props;
    // const {name} = props;
    return (
        <div>

        <h1
        className = "header--name"
        style={{
            backgroundColor: "gray",
        }}
        >
            Hello {props.name}
            </h1>
            <h2>Menus</h2>
            <div>children</div>
            </div> 
    );
};


const App = () => {
    const name = "1231231";
    return (
        <div>
            <Header name={name} >
                <div>어쩌구</div>
            </Header>
        </div>
    );
};

//export { App };
export default App;
